import logo from './logo.svg';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { Box, Grid, Stack, Tab, Tabs, Typography } from '@mui/material';
import CssBaseline from '@mui/material/CssBaseline';
import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import './App.css';


function App() {
    const theme = createTheme({
        palette: {
            primary: {
              main:  '#da8129',
              dark: '#ffffff',
              light: '#ffffff',
              contrastText: 'rgba(0,0,0,0.87)',
            },
            secondary: {
              main: '#da8129',
            },
            background: {
              paper: '#ffffff',
              default: '#fff6ec',
            },
        },
        components: {
            MuiTab: {
                styleOverrides: {
                    root: {
                        color: '#da8129', // Customize text color
                        textTransform: 'lowercase',
                        fontFamily: [
                            '-apple-system',
                            'BlinkMacSystemFont',
                            '"Segoe UI"',
                            'Roboto',
                            '"Helvetica Neue"',
                            'Arial',
                            'sans-serif',
                            '"Apple Color Emoji"',
                            '"Segoe UI Emoji"',
                            '"Segoe UI Symbol"',
                        ].join(','),
                        '&.Mui-selected': {
                            color: '#da8129', // Customize selected tab text color
                        },
                    },
                },
            },
        }
    })
    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Stack direction="row" sx={{display: 'flex', width: '100%'}}>
                <Grid container>
                    <Grid item xs={8}>
                        <Stack direction="row">
                            <FilterVintageIcon />
                            <Typography sx={{alignContent: 'center', pl: 2, pt:2, fontFamily: "Berkshire Swash"}} variant='h4' color="primary.main"> Sega Birhane</Typography>
                        </Stack>
                    </Grid>
                    <Grid item xs={4}>
                        <Tabs
                            sx={{
                                justifyContent: 'flex-end',
                                alignItems: 'flex-end'
                            }}
                            value={0}
                        >
                            <Tab  label="About Me"/>
                            <Tab  label="projects"/>
                            <Tab  label="resume"/>
                            <Tab  label="contact me"/>
                        </Tabs>
                    </Grid>
                </Grid>
             </Stack>
        </ThemeProvider>
  );
}

export default App;
